import React from "react";
import Router from "react-router-dom";

import Navbar from "./components/Navbar";
import MainBody from "./components/MainBody";

class App extends React.Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <MainBody />
        </Router>
      </div>
    );
  }
}

export default App;
